window.bookSummaryJSON = "<p>Long ago, the Builders ruled the stars, using a unique super-science to create marvels and wonders. But the Builders vanished - no one knows why - leaving many of their treasures hidden throughout the galaxy.</p> <p>Now, Captain Maddox and arrogant New Men learn about the fabled Library Planet. Legend holds itâ€™s an ancient repository of Builder knowledge. The side that plunders the planetary vaults first will surely become the premier power in the Orion Spiral Arm.</p> <p>The race is on, but with many unforeseen dangers including deadly ghost-ships, possible time-travelers, and cunning spies - others desire what lies inside the Library Planet.</p> <p>This will prove a desperate struggle as puny humans led by Captain Maddox try to wrench an advantage for Star Watch, and as a grim menace of unparalleled horror slowly unfolds before them.<i> The Lost Secret</i> is the 14th book in the Lost Starship Series.</p>"; 
